"use client";

import { useRouter } from "next/navigation";
import type { MouseEventHandler } from "react";
import IconOptions, { LinkIconProps } from "@/app/types/IconOptions";

const AppleIcon = ({
  width = "5rem",
  height = "5rem",
  className,
  to = "#",
  onClick,
}: LinkIconProps) => {
  const router = useRouter();

  const handleClick: MouseEventHandler<SVGSVGElement> = (e) => {
    if (onClick) {
      onClick(e); // 외부 핸들러 실행
    }

    if (!e.defaultPrevented) {
      router.push(to); // 지정된 경로로 이동
    }
  };

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 50 50"
      width={width}
      height={height}
      fill="none"
      className={className}
      onClick={handleClick}
      role="button"
      style={{ cursor: "pointer" }}
    >
      <rect
        x="0.5"
        y="0.5"
        width="49"
        height="49"
        rx="24.5"
        fill="url(#pattern0_385_862)"
        stroke="#ABABAB"
      />
      <defs>
        <pattern
          id="pattern0_385_862"
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <use
            href="#image0_385_862"
            transform="matrix(0.0036075 0 0 0.0035917 -1.11596 -0.183712)"
          />
        </pattern>
        <image
          id="image0_385_862"
          width="640"
          height="360"
          preserveAspectRatio="none"
          href="data:image/png;base64,"
        />
      </defs>
    </svg>
  );
};

export default AppleIcon;
